import React from "react";
import SearchBar from "../SearchBar";
import style from "../Nav/Nav.module.css";

const Nav = () => {
  return (
    <div className={style.container}>
      <nav>
        <SearchBar onSearch={(characterID) => window.alert(characterID)} />
      </nav>
    </div>
  );
};

export default Nav;
